data:
  definition: capacité d'un résonateur piézoélectrique mesurée à une fréquence très
    inférieure à la plus basse résonance
  examples: []
  notes:
  - Les capacités parasites entre les bornes du résonateur sont incluses dans la capacité
    libre.
  - Cet article était numéroté 561-02-34 dans l'IEC 60050-561:1991.
